import React from 'react';

const List = () => {
    return (
        <ul>
        {getPostData.map((item,idx) => (
        <li key={idx}>
            <span>{item._id}</span>
            <span>{item.nickName}</span>
            <p>{item.content}</p>
            <em>{item.createdAt}</em>
            <span>{item.__v}</span>
        </li>))}
    </ul>
    );
};

export default List;
